import React, { Component } from 'react';
import styles from "./custom.module.css" ;
class Login extends Component {
    constructor(){
        super();
        this.state = {
         username: '',
         password: '',
        };
        this.register = this.register.bind(this);
        this.onChange = this.onChange.bind(this);

    }
    onChange(e){
        this.setState({[e.target.name]:e.target.value});
    }

    register() {

    }

    render() { 
        return (
            <div>
                <div className="container-fluid">
                    <div class="jumbotron">
                        <h1 className="text-center font-weight-light">CONTACTS</h1>
                    </div>
                </div>
                <div className="container yellam">
                    <form role="form"  method="post" action="login.php">
                        <div className="form-group">
                            <div className="row">
                                <div className="col-xs-3">
                                User Name:
                                <input className="form-control" id="username" name="username" type="text" placeholder="username"/>
                                </div>
                            </div>
                            <br></br>
                            <div className="row">
                                <div className="col-xs-3">
                                Password:
                                <input className="form-control" id="password" name="password" type="password" placeholder="password"/>
                                </div>
                            </div>
                            <br></br>
                            <div className="row">
                                <div className="col-xs-3">
                                    <input type="submit" className="btn btn-primary" value="login"/>
                                </div>
                            </div>
                        </div>
                        <div>
                            <div className="text-muted">new user?<a href='signup.php'><button type="button" className="btn btn-primary">Sign Up</button></a>
                            </div>
                        </div>
                    </form>
                </div>
            <h1 className={styles.bigblue}>Hello Car!</h1>;
            </div>   
        );
    }
}

export default Login;
